INSERT INTO galeria VALUES("25", "2", "2006-12-07", "FOTOS FINAL COPA MOTOCAR DE ENDURO 2006", "No último dia 3 de dezembro, os trilheiros do barril marcaram presença na última etapa da copa motocar de enduro 2006. A prova teve 113,00 Km de extenção com um alto nível de exigência dos pilotos, pois as médias estavam bem juntas, não dando espaço para erros de navegação. Na cat. Master, Cassiano obteve a terceira colacação, já na Estreantes Jorge terminou em 4º, Claiton M. \"cavalo\" em 16º e Marcos Lima em 21º. Também na reunião de sábado foi confirmada mais uma etapa em 2007.");
INSERT INTO galeria VALUES("26", "3", "0000-00-00", "costelão", "");
INSERT INTO galeria VALUES("27", "1", "2007-02-04", "TRILHA PASSEIO EM IRAÍ", "No dia 04/02 o Moto Clube Trilheiros do Barril esteve na cidade turística de Iraí, para uma trilha passeio organizada pelo moto clube da cidade. A trilha foi espetacular, com belas paisagens e bom lugares para \"brincar\" com a moto, sendo que o preferido foi uma subida na beira da estrada com cerca de 12 metros.");
INSERT INTO galeria VALUES("28", "1", "2007-03-04", "11ª Edição Copa Motocar de Enduro", "No último dia 04 teve início a 11ª edição da Copa Motocar de Enduro de regularidade na cidade de Quilombo/SC. Estiveram prestigiando o evento em torno de 120 motos dos 3 estados do sul. A prova foi muito técnica, já que na sexta e no sábado São Pedro esqueceu as torneiras abertas alagando tudo, até a cidade, o que deixou as médias mais justas, mas no final foi uma prova show, parabéns aos organiadores.");
INSERT INTO galeria VALUES("29", "2", "2007-05-06", "Enduro dos Mártires", "Esta quase tudo pronto para o 4º enduro de Frederico Westphalen, agora se chama Enduro dos Mártires, prova essa válida pela 4ª etapa da copa Motocar e também inédito em frederico, pela 5ª e 6ª etapas do campeonato gaúcho de regularidade. A prova esta ficando muito boa, venha conferir e desde já sejam todos Bem Vindos.");
INSERT INTO galeria VALUES("30", "1", "2007-05-06", "ENDURO DOS MÁRTIRES", "");
INSERT INTO galeria VALUES("32", "2", "2007-05-06", "FOTOS ENDURO DOS MÁRTIRES", "Foi um sucesso o 4º Enduro de Frederico Westphalen (Enduro dos Mártires), o Moto Clube Trilheiros do Barril gostaria de agradecer a todos os pilotos que aqui estiveram, a todos que de uma forma ou outra colaboraram para a realização deste grande evento, mas em especial aos proprietários das terras onde passaram as trilhas da prova, um grande abraço a todos. ");
INSERT INTO galeria VALUES("33", "2", "2007-12-08", "Trilhão de Final de Ano", "No dia 08/12/2007 ocorreu mais um trilhão na Cidade de Frederico Westphalen promovido pelos Trilheiros do Barril. Participaram integrantes de outros Motoclubes das Cidades de Tenente Portela, Erval Seco, Sarandi, Carazinho, Seberi, Palmitinho, e outras. O trilhão se deu em um percurso de 60 km, o qual foi muito comemorado pelos trilheiros, pois propiciou belas paisagens e aventuras.");
